description:
Almost Relatives
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: Things become heated between a bride and the best man when their explosive attraction to one another makes them question their loyalty to the groom. When father-of-the-bride, Tommy wakes up naked in the maid-of-honor's bed, he realizes that maybe there is great sex after marriage. A illicit affair between groom, Chad and his future mother-in-law reaches a breaking point when things get hot and heavy just hours before the wedding. Unprepared and flustered by her responsibilities as a bridesmaid, Scarlet gets swept up in an afternoon tryst with the minister when he gives her a massage as a way of de-stressing her.

Cast: Brandi Love, Scarlet Red, Jessa Rhodes, Karla Kush, Steven St. Croix, Tommy Gunn, Logan Pierce, Chad White, Jacky St. James,Director

